    "Manufacturing Advanced Channel Wall Rocket Liners Project",nt"tracking_summary":
    {ntt"total": 8,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:22:32.103515",nt"name": "manufacturing-advanced-channel-wall-rocket-liners-project",nt"isopen":
    true,nt"url": null,nt"notes": "This SBIR will adapt and demonstrate a low
    cost flexible method of manufacturing channel wall liquid rocket nozzles and combustors,
    while providing developers a means to manufacture more complex designs for improved
    engine performance.rnCurrent channel wall engine concepts are limited by capabilities
    of available manufacturing methods.  This SBIR will provide a cold, non-chemical,
    low load alternative while supporting more complex liner designs.  It will enable
    features such as cooling channels with complex patterns, bifurcations, flow trips,
    varying width and depth, thin hot walls, negative wall taper, more accurately placed
    channel walls and more complex liner contours.rnOrmond will work together with contacts
    at NASA and Aerojet Rocketdyne during Phase I to provide demonstration coupons of
    current engine concepts and to identify additional design options that can be incorporated
    through use of the proposed technology.  Cost and technical feasibility will be
    demonstrated.rnA Phase II program will result in a TRL-6 level means of machining
    channel combustor and nozzle liners.  Scalability to SSME class of engines will
    be addressed.  rnGovernment and commercial applications that may benefit from the
    proposed technology development include channel wall liquid rocket engines, ground
    based turbine generators, advanced turbine blades, scramjets, space optics, and
    down-hole oil well tooling.",nt"license_title": "U.S. Government Work",nt"extras":
